    result = {}
    stars_match = re.search('<gh_stars>(\\d+)', record)
    if stars_match:
        result['gh_stars'] = int(stars_match.group(2))
    name_match = re.search('#PBS -N (.+)', record)
    if name_match:
        result['job_name'] = name_match.group(1)
    resource_match = re.search('#PBS -l select=(\\d+):ncpus=(\\d+):mem=([0-9a-zA-Z]+)', record)
    if resource_match:
        result['resource_allocation'] = {'select': int(resource_match.group(1)), 'ncpus': int(resource_match.group(2)), 'mem': resource_match.group(3)}
    walltime_match = re.search('#PBS -l walltime=(\\d+:\\d+:\\d+)', record)
    if walltime_match:
        result['resource_allocation']['walltime'] = walltime_match.group(1)
    module_match = re.search('module load (.+)', record)
    if module_match:
        result['module'] = module_match.group(1)
    return result

